import TaskList from "./TaskList";

export default function HeadingText(props){
    const {tasks, setTasks, filter} = props;
    const taskList = <TaskList tasks={tasks} setTasks={setTasks} filter={filter}/>
    tasksNoun = taskList.length !== 1 ? 'tasks' : 'task';
    return (`${taskList.length} ${tasksNoun} remaining`)
}
